---
Name: deploynautconfig
---
DNProject:
  defaults:
    DiskQuotaMB: "1024"
Group:
  belongs_many_many:
    "Projects": "DNProject"
GridFieldDetailForm_ItemRequest:
  extensions:
    - FrontendLink
StateMachineFactory:
  handlers:
    DNDeployment:
      submit:
        DNDeploymentHandlers: onSubmit
      queue:
        DNDeploymentHandlers: onQueue
      abort:
        DNDeploymentHandlers: onAbort
